import React from 'react';
import './index.scss'; // Import the SCSS file
import img from "../../assets/images/woopiebounce.png";
const Projects = () => {
  const projects = [
    {
      id: 1,
      title: 'Field Manager',
      img : 'baseballField.jpg',
      description: 'Full-stack application allowing people to book baseball fields',
      technologies: ['BootStrap', 'Node.js', 'PostgreSQL', 'JavaScript']
    },
    {
      id: 2,
      title: 'Json Parser',
      img : 'json.jpg',
      description: 'Json File Validator',
      technologies: ['Python', 'NodeJS', 'Regex']
    },
    {
        id: 3,
        title: 'Rubiks Cube Time',
        img : "../../assets/images/logo-xs.png",
        description: 'Inspired By my Love of Rubiks Cubes',
        technologies: ['JavaScript', 'NodeJS']
      },
      {
      id: 4,
      title: img,
      img : "../../assets/images/woopiebounce.png",
      description: '2D Platformer game made as a team as part of a Hackathon',
      technologies: ['Unity', 'C#', 'Graphic design']
    }
  ];

  return (
    <section className="projects__container">
      <h2 className="projects__title">Projects</h2>
      <div className="projects__grid">
        {projects.map((project) => (
          <div 
            key={project.id} 
            className="projects__card"
          >
            <div className="projects__card-content">
              <h3 className="projects__card-title">{project.title}</h3>
              <img src={project.img}></img>
              <p className="projects__card-description">{project.description}</p>
              <div className="projects__tech-list">
                {project.technologies.map((tech) => (
                  <span 
                    key={tech} 
                    className="projects__tech-tag"
                  >
                    {tech}
                  </span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
